import * as React from 'react';
import TextField from '@mui/material/TextField';
import Autocomplete from '@mui/material/Autocomplete';

export default function DisabledOptions() {
  return (
    <>
    <Autocomplete
      id="disabled-options-demo"
      options={timeSlots}
      sx={{ width: 125 }}
      renderInput={(params) => <TextField {...params} label="Inicio" />}
    />
    <Autocomplete
      id="disabled-options-demo"
      options={timeSlots}
      sx={{ width: 125 }}
      renderInput={(params) => <TextField {...params} label="Final" />}
    />
    </>
  );
}

// One time slot every 30 minutes.
const timeSlots = Array.from(new Array(12 * 2)).map(
  (_, index) =>
    `${index < 10 ? '0' : ''}${Math.floor(index)}:${'00'}`,
);
